from typing import List
class Solution:
    def countPyramids(self, grid: List[List[int]]) -> int:
        pref = [[0 for _ in range(len(grid[0]))] for _ in range(len(grid))]
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 1:
                    pref[i][j] = pref[i][j-1]+1
        
        def checker(p, i, j, bt, isUpward):
            # check the upward first
            # check the above one is a pyramid or not
            # toCheck = (bt-1)//2
            di = -1*((bt-1)//2)
            dj = -1*((bt-1)//2)

            if abs(di) == 1:
                if p[i+di][j+dj]:
                    dp[i+di][j+dj][0 if isUpward else 1] = bt
                    return True
                else:
                    dp[i+di][j+dj][0 if isUpward else 1] = False
                    return False
            else:
                if dp[i+di][j+dj][0 if isUpward else 1] == bt-2:
                    dp[i+di][j+dj][0 if isUpward else 1] = bt
                    return True
                else:
                    dp[i+di][j+dj][0 if isUpward else 1] = False
                    return False
                
        dp = [[[0,0] for _ in range(len(grid[0]))] for _ in range(len(grid))]
        def counter(p, isUpward=True):
            # say pyramid has bottom = 3+
            # check the apex is legit as previous bottom
            bottomToCheck = [3]
            res = 0
            while bottomToCheck:
                bt = bottomToCheck.pop()
                h = (bt-1)//2
                diff = 0
                for i in range(h,len(p)):
                    for j in range(len(p[0])-1, bt-2, -1):
                        if p[i][j] >= bt:
                            diff += checker(p, i, j, bt, isUpward)
                if diff:
                    res += diff
                    bottomToCheck.append(bt+2)
            return res

        if pref == pref[::-1]:
            return 2*counter(pref)
        else:
            return counter(pref) + counter(pref[::-1], False)

